const archivesContext={initExpander(){$(".joe_archives-timelist .panel").on("click",(function(){const $this=$(this),$titleHeight=$this.outerHeight(),$conHeight=$this.next(".panel-body").outerHeight(),$wrapper=$this.parent();$this.hasClass("in")?($this.removeClass("in"),$wrapper.height($titleHeight+"px")):($this.addClass("in"),$wrapper.height(`${$titleHeight+$conHeight}px`))}))}};document.addEventListener("DOMContentLoaded",(function(){archivesContext.initExpander()}));